import React from 'react';
import logo from './assets/Spotify_Logo.png';

function Login() {
    return (
        <div className="Login">
            <div>
                <div className='logo_login'>
                    <img
                    src={logo}
                    alt="Spotify Logo"
                    width="300"
                    />
                </div>
                <a className="btn-spotify" href="/auth/login" >
                    Login with Spotify 
                </a>
            </div>
        </div>
    );
}

export default Login;
